import React from 'react';
import { ThemeProvider } from 'emotion-theming';
import './App.css';
import {
  Box,
  Card,
  Image,
  Heading,
  Text,
  Flex,
  Link
} from 'rebass';
import theme from '@rebass/preset'


function App() {
  return (
    <ThemeProvider theme={theme}>
      <Flex
        px={2}
        py={2}
        fontSize={[]}
        color='white'
        bg='black'
        alignItems='center'>
        <Link p={2} fontWeight='bold' variant='nav' href='#'>Portfolio</Link>
        <Box mx='auto' />
        <Link variant='nav' href='https://docs.google.com/document/d/16W_dKgtt6Cmp8hbCrA0m1I2M0Lt00a0-06X4OtrRoG4/edit?usp=sharing' target='_blank'>Resume</Link>
        <Link variant='nav' href='https://github.com/Cfor0' target='_blank'>Github</Link>
      </Flex>
    </ThemeProvider>
  );
}

export default App;
